import React from 'react';
import { Link } from 'react-router-dom';

const EventDetail = ({eventname, eventurl}) => {
	if(!eventname) {
		return <div>Loading...</div>;
	}
	return (
		<div>
			<h4>{eventname}</h4>
			<a href="${eventurl}"> </a>
		</div>
	);
}

export default EventDetail;
